function List(){

    const fruits = [{name:"apple", calories: 95},
                    {name:"orange", calories: 45},
                    {name:"banana", calories: 105}]
    const listItems = fruits.map(fruit => <li>{fruit}</li>);
    return(<ul>{listItems}</ul>);
}

export default List
